import useInput from "../hooks/useInput";

const PostForm = () => {
  const [text, onChangeText] = useInput("");
  const onSubmit = useCallback(() => {}, []);

  return (
    <Form onFinish={onSubmit}>
      <Input.TextArea
        value={text}
        onChange={onChangeText}
        maxLength={140}
        placeholder="오늘의 기분을 적어주세여"
      />
      <div>
        
      </div>
    </Form>
  );
};

PostForm.propTypes = {};

export default PostForm;
